import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { getGameList } from '../../actions/rawg-api';
import CategoryListItem from './CategoryListItem';
import '../../scss/browse_page/browse_page.scss';

export default class BrowsePage extends Component {
  constructor() {
    super();
    this.state = {};
  }

  componentDidMount() {
    console.log('browse mounted');
    const games = getGameList('genre', 'adventure');
    console.log(games);
  }

  render() {
    return (
      <Container className="w-100 py-5" id="browse-container">
        <Row>
          <Col xs={{ order: 2 }} lg={{ order: 1 }}>
            <div className="pb-2">
              <p>Sort By: Release Date</p>
            </div>
            <p>games here</p>
          </Col>
          <Col xs={{ span: 12, order: 1 }} lg={2}>
            <div className="bottom-border pb-2">
              <p>Filters</p>
            </div>
            <div className="mt-3">
              <p className="category-list">Action</p>
            </div>
          </Col>
        </Row>
      </Container>
    );
  }
}
